import "../style/mainpage.css"

function MainPage() {
    return (
        <div className="mainpage">
            <div className="landingPg1"></div>
            <div className="landingPg2"></div>
            <div className="landingPg3"></div>
            <div className="landingPg4"></div>
        </div>
    )
}

export default MainPage
